import request from '@/utils/request'; //备件领用出库主信息查询（出库登记）

export function queryRecords(query) {
  return request({
    url: "/iwms/plans/useOrders",
    method: 'get',
    params: query
  });
} //备件领用出库明细信息查询（出库登记）

export function queryRecordItems(useOrderCode, query) {
  return request({
    url: "/iwms/plans/useOrders/".concat(useOrderCode, "/details"),
    method: 'get',
    params: query
  });
} //备件领用出库保存

export function Save(data) {
  return request({
    url: "/iwms/outStocks",
    method: 'post',
    data: data
  });
} //备件领用出库主表查询（出库凭证）

export function queryRecordsMain(query) {
  return request({
    url: "/iwms/outStocks",
    method: 'get',
    params: query
  });
} //备件领用出库明细查询（出库凭证）

export function queryRecordsSub(query) {
  return request({
    url: "/iwms/outStocks/".concat(query.outOrderNumber, "/details"),
    method: 'get',
    params: query
  });
} //获取区位

export function getArea(warehouseCode) {
  return request({
    url: "/base-modeling/warehouses/".concat(warehouseCode, "/areas"),
    method: 'get'
  });
} //获取储位

export function getLocator(warehouseCode, areaCode) {
  return request({
    url: "/base-modeling/warehouses/".concat(warehouseCode, "/areas/").concat(areaCode, "/locations"),
    method: 'get'
  });
}
